import React, { Component } from 'react'  

export class Header extends Component {  
    render() {  
        return (  
          <div>
            <header id="header">
              <h1>Arscan</h1>
              <p>Experience AR without installation nor hesitation.. <br/>whether it's photo album, invitation card, interactive art exhibition, or merchandise</p>
            </header>
			    </div>
        )  
    }  
}  

export default Header
